object Solution {
  val Mod: Int = 1e9.toInt + 7

  def count(num1: String, num2: String, min_sum: Int, max_sum: Int): Int = {
    def digitSum(n: BigInt): Int = n.toString.map(_.asDigit).sum

    def dfs(n: String, idx: Int, tight: Boolean, less: Boolean, sum: Int): BigInt = {
      if (idx == n.length) {
        if (sum >= min_sum && sum <= max_sum) 1 else 0
      } else {
        val limit = if (tight) n(idx) - '0' else 9
        (0 to limit).foldLeft(BigInt(0)) { (acc, digit) =>
          acc + dfs(n, idx + 1, tight && digit == limit, less || digit < limit, sum + digit)
        }
      }
    }

    def solve(n: String): BigInt = {
      dfs(n, 0, tight = true, less = false, 0)
    }

    val res = solve(num2) - solve((BigInt(num1) - 1).toString())
    (res % Mod).toInt
  }
}
